/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmControlSpacer 
} from '@vime/core';

import { define } from '../lib';


define('vm-control-spacer', VmControlSpacer);


export interface ControlSpacerProps extends JSX.VmControlSpacer, HTMLAttributes<HTMLVmControlSpacerElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmControlSpacerElement, ControlSpacerProps>(
  'vm-control-spacer',
  new Set([]),
);
